import React from 'react'
import "./sidebar.css"
import Create from "../components/Create"

const SideBar = () => {
  return (
    <div class="sidebar">
        <a class="active" href="/">Home</a>
        <a href="/create">Contact</a>
        <a href="#about">About</a>
    </div>
)
}

export default SideBar
